import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-3c92919b30f5d",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/uros/projects/aca/cv/docs/index.md").then(comp => {
        Vue.component("v-3c92919b30f5d", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-c92f36e236851",
    path: "/info.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/uros/projects/aca/cv/docs/info.md").then(comp => {
        Vue.component("v-c92f36e236851", comp.default)
        next()
      })
    }
  },
  {
    name: "v-bfacc8617f69",
    path: "/skills.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/uros/projects/aca/cv/docs/skills.md").then(comp => {
        Vue.component("v-bfacc8617f69", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
